import styled from "styled-components";

export default function Experience({language}) {
    return (
        <Container>
            {!language ? <>

            </> :
            <>

            </>}
            <h1>Educação</h1>
            <div>
                <div>
                    <img src="/assets/poli.png" alt="Logo Poli"/>
                    {!language ? <>
                        <h1>Escola politécnica da USP</h1>
                        <h2>Engenharia Elétrica</h2>
                    </> :
                    <>
                        <h1>Escola politécnica da USP</h1>
                        <h2>Electrical Engineering</h2>
                    </>}
                    <h1>Education</h1>
                </div>
                <div>
                    <img src="/assets/driven.png" alt="Logo Driven"/>
                    {language ? <>
                        <h1>Driven Education</h1>
                        <h2>Desenvolvedor Web Fullstack</h2>
                    </> :
                    <>
                        <h1>Driven Education</h1>
                        <h2>Fullstack Web Developer</h2>
                    </>}
                </div>
            </div>
        </Container>
    );
}

const Container = styled.div`
    height: 85vh;
    padding-left: 5%;
    padding-right: 5%;
    display: flex;
    flex-direction: column;
    background-color: #555555;;

    h1{
        padding-top: 10vh;
        font-size: 40px;
        font-weight: 700;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    div {
        display: flex;
    }

    h2 {
        padding-top: 5vh;
        font-size: 20px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }
`
